// import {Container, StyledButton} from "./style";
function Footer() {
    return (
        <>
            <ul>
                <li>item 1</li>
                <li>item 2</li>
                <li>item 3</li>
                <li>item 4</li>
                <li>item 5</li>
            </ul>
            <Container>
                <StyledButton>Normal Button</StyledButton>
                <StyledButton>Primary Button</StyledButton>
            </Container>
        </>
    );
}

export default Footer;
